Commercial Litigation and Dispute Resolution; Family Law; Caveat Disputes;
      Employment Law; Wills/Estates/Probate/Letters of Administration; Debt Recovery;
      Statutory Demand matters; Lease Disputes; and Sale of Business and Property

      disputes.

I completed a placement with the Fair Work Commission (FWC) in the Unfair Dismissals Case Management Team. This experience provided me with an opportunity to gain valuable insight in to the work of the FWC, in particular the day to day case management of Unfair Dismissal Applications.

My responsibilities at FWC included:

- Corresponding with Applicants/Respondents;
- Listing Unfair Dismissal Hearings; 
- Attending and observing Tribunal Hearings and Conciliation Conferences;
- Organising files for Chambers

description:
Wide and deep experience across the petroleum and energy value chain as a commercial, legal and compliance professional:
•	Business Development;
•       Upstream, LNG joint ventures and project development (greenfield and brownfield);
•	Strategy development and execution;
•       Stakeholder management and integration (internal and external);
•	Commercial agreements and C&P;
•	Joint venture governance;
•	Deal delivery/M&A;
•	Downstream and operations;
•	New energies/renewables;
•	Wide business network.

Strong leadership attributes with broad strategic focus.  Strong collaborator, team player and integrator. Delivery and solution driven. High energy, curious continuous learner.
